import useFetch from "../hooks/useFetch"

function Home() {
  const info = useFetch(`http://localhost:4000/`)
console.log(info);
  return (
    <main>
      <p>Noticia</p>
      <div className="noticiero">
      {info && info.map(r =>
          <div>{r.id}</div>
        )
      }
      </div>
    </main>
  )
}

export default Home;
